#
# TABLE STRUCTURE FOR: delivery_methods
#

DROP TABLE IF EXISTS `delivery_methods`;

CREATE TABLE `delivery_methods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название способа доставки',
  `company_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на компанию, которая добавила способ доставки',
  `status` tinyint(1) DEFAULT NULL COMMENT 'Статус метода доставки, активен или нет',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Способы доставки компаний';



#
# TABLE STRUCTURE FOR: offers
#

DROP TABLE IF EXISTS `offers`;

CREATE TABLE `offers` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `company_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на компанию-инициатора предложения',
  `summary` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Заголовок предложения',
  `description` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание предложения',
  `price` decimal(10,0) NOT NULL COMMENT 'Цена за услугу или товар в предложении',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT 'Статус - опубликовано или нет',
  `product_id` int(10) unsigned DEFAULT NULL COMMENT 'Ссылка на товар',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=251 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Предложения';



#
# TABLE STRUCTURE FOR: products
#

DROP TABLE IF EXISTS `products`;

CREATE TABLE `products` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор товара',
  `category_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на категорию товара',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название товара',
  `description` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание товара',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Товары';



#
# TABLE STRUCTURE FOR: products_categories
#

DROP TABLE IF EXISTS `products_categories`;

CREATE TABLE `products_categories` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор категории товара',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название категории товара',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Категории товара';



#
# TABLE STRUCTURE FOR: products_files
#

DROP TABLE IF EXISTS `products_files`;

CREATE TABLE `products_files` (
  `product_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на товар',
  `file_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на файл',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`product_id`,`file_id`) COMMENT 'Составной первичный ключ'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Связь между товарами и прикрепленными файлами';



#
# TABLE STRUCTURE FOR: requests
#

DROP TABLE IF EXISTS `requests`;

CREATE TABLE `requests` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `company_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на компанию-инициатора запроса',
  `summary` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Заголовок запроса',
  `description` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание запроса',
  `price` decimal(10,0) NOT NULL COMMENT 'Цена за услугу или товар в запросе',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT 'Статус - опубликовано или нет',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Запросы';



